import React from 'react';
import Jumbotron from 'react-bootstrap/Jumbotron';

export const HomePage = () => (
        <div className="container">
          <Jumbotron>
            <h1> About Me</h1>
            <p>
            My name is Nick. I am a data scientist and a software manager
            </p>

          <img src="./files/profile_pic.jpg" alt="Profile Picture"/>

          </Jumbotron>
        </div>



)
